/**
 * Updates the <code>iPlanetAMPlatformService<code> service schema.
 *
 * @return true if successful otherwise false.
 */
public boolean migrateService() {
  String classMethod = "iPlanetAMPlatformService/20_30:migrateService: ";
  boolean isSuccess = false;
  try {
    String fileName = UpgradeUtils.getAbsolutePath(SERVICE_DIR, SCHEMA_FILE1);
    UpgradeUtils.addAttributeToSchema(SERVICE_NAME, schemaType, fileName);
    // add subschema
    fileName = UpgradeUtils.getAbsolutePath(SERVICE_DIR, SCHEMA_FILE);
    UpgradeUtils.addSubSchema(SERVICE_NAME, null, schemaType, fileName);
    fileName = UpgradeUtils.getAbsolutePath(SERVICE_DIR, SCHEMA_FILE2);
    UpgradeUtils.createService(fileName);

    UpgradeUtils.removeAttributeSchema(SERVICE_NAME, schemaType, ATTR_LOGIN_URL, null);
    UpgradeUtils.removeAttributeSchema(SERVICE_NAME, schemaType, ATTR_LOGOUT_URL, null);
    UpgradeUtils.removeAttributeSchema(SERVICE_NAME, schemaType, ATTR_SERVER_VALIDATOR, null);
    UpgradeUtils.removeAttributeSchema(SERVICE_NAME, schemaType, ATTR_SITE_VALIDATOR, null);
    UpgradeUtils.removeAttributeSchema(SERVICE_NAME, schemaType, ATTR_LOCALES, null);

    // read serverdefaults.properties
    Properties properties = new Properties();
    try {
      properties.load(new FileInputStream(UpgradeUtils.getServerDefaultsPath()));
    } catch (IOException ioe) {
      UpgradeUtils.debug.error("Error loading properties", ioe);
    }
    Set vSet = new HashSet();
    Enumeration propertiesNames = properties.propertyNames();
    while (propertiesNames.hasMoreElements()) {
      String propertyName = (String) propertiesNames.nextElement();
      String value = (String) properties.get(propertyName);
      vSet.add(propertyName + "=" + value);
    }
    // add to server-default subconfig
    UpgradeUtils.addServerDefaults(SERVICE_NAME, SERVER_ATTR, null, INSTANCE_ID, vSet, null);
    if (UpgradeUtils.debug.messageEnabled()) {
      UpgradeUtils.debug.message(
          classMethod + "serverdefaults.properties " + "values are :" + vSet);
    }

    // get the values of site list.
    Set attrValueSet = UpgradeUtils.getAttributeValue(SERVICE_NAME, ATTR_SITE_LIST, schemaType);
    Iterator i = attrValueSet.iterator();
    while (i.hasNext()) {
      String attrVal = (String) i.next();
      String siteURL = null;
      String remStr = null;
      int index = attrVal.indexOf("|");
      if (index != -1) {
        siteURL = attrVal.substring(0, index);
        remStr = attrVal.substring(index + 1);
      }
      index = remStr.indexOf("|");
      if (index != -1) {
        String siteId = remStr.substring(0, index);
        String accessPointStr = remStr.substring(index + 1);
        StringTokenizer st = new StringTokenizer(accessPointStr, "|");
        Set accessPoints = new HashSet();
        while (st.hasMoreTokens()) {
          accessPoints.add((String) st.nextToken());
        }
        UpgradeUtils.createSite(siteURL, accessPoints);
      }
    }

    /* Get existing/pre-migrated AMConfig.properties,
     * get the latest AMConfig.properties from the deployed
     * OpenSSO pointing to old DIT. Read the
     * "com.iplanet.am.version" from the latest OpenSSO bits
     * and replace only property in the existing/pre-migrated
     * AMConfig.properties.
     */

    String serverStr = UpgradeUtils.getServerName() + "/" + UpgradeUtils.getDeployURI();
    Properties amconfigProp = UpgradeUtils.getServerProperties();
    Properties p =
        UpgradeUtils.getProperties(
            UpgradeUtils.getConfigDir() + File.separator + "AMConfig.properties");
    String prodVersion = (String) p.get("com.iplanet.am.version");
    if (prodVersion != null) {
      amconfigProp.put("com.iplanet.am.version", prodVersion);
      UpgradeUtils.storeProperties(amconfigProp);
    }
    // get value of iplanet-am-platform-server-list attribute
    attrValueSet = UpgradeUtils.getAttributeValue(SERVICE_NAME, PLATFORM_ATTR, schemaType);

    Iterator attrValIterator = attrValueSet.iterator();
    while (attrValIterator.hasNext()) {
      String value = (String) attrValIterator.next();
      StringTokenizer st = new StringTokenizer(value, "|");
      String serverName = st.nextToken();
      String serverId = st.nextToken();
      String siteId = null;
      if (st.countTokens() == 3) {
        siteId = st.nextToken();
      }
      // get complete instance name with deployURI
      String serverInstance = UpgradeUtils.getServerInstance(serverName);
      if (serverName != null && serverName.equalsIgnoreCase(serverStr)) {
        Set values = getValues(amconfigProp);
        // read serverconfig XML
        String serverconfigXML = UpgradeUtils.getServerConfigXML();
        if (UpgradeUtils.debug.messageEnabled()) {
          UpgradeUtils.debug.message(
              classMethod + "AMConfig.properties " + "values are :" + values);
          UpgradeUtils.debug.message(classMethod + "serverconfigXMl is :" + serverconfigXML);
        }
        UpgradeUtils.addServerDefaults(
            SERVICE_NAME, SERVER_ATTR, serverInstance, serverId, values, serverconfigXML);
      } else {
        UpgradeUtils.createServiceInstance(serverInstance, serverId);
      }
      if (siteId != null) {
        UpgradeUtils.addToSite(serverInstance, siteId);
      }
    }
    isSuccess = true;
  } catch (UpgradeException e) {
    UpgradeUtils.debug.error("Error loading data:" + SERVICE_NAME, e);
  }
  return isSuccess;
}

/**
 * This method will help remove those function deleted in scene from mappingData and add those
 * from scene to mappingData. Therefore, after calling this method, both mappingData and/or
 * uuidComponentMap structure may change.
 *
 * @param mappingData
 * @param uuidComponentMap
 */
private void consolidateFunctionComponentList(
    Mapping mappingData, java.util.Map<String, FunctionComponent> uuidComponentMap) {
  List<FunctionComponent> oldFunctionCompList = mappingData.getFunctionComponent();
  Iterator it = oldFunctionCompList.iterator();
  while (it.hasNext()) { // remove those not exist anymore in new mapping
    FunctionComponent functionComp = (FunctionComponent) it.next();
    FunctionComponent newFunctionComp = uuidComponentMap.get(functionComp.getXmlPath());
    if (newFunctionComp
        == null) { // could not find the old functionComp in new graph, that implies it is deleted
                   // already
      it.remove();
    } else {
      // update view and functionMeta info, if any
      functionComp.setMeta(newFunctionComp.getMeta());
      functionComp.setView(newFunctionComp.getView());
      // then remove the new one from the map, so after this filtering, the given map will just
      // contain those need to be added.
      uuidComponentMap.remove(functionComp.getXmlPath());
    }
  }
  // now add new function components into mappingData
  it = uuidComponentMap.keySet().iterator();
  while (it.hasNext()) {
    Object key = it.next();
    FunctionComponent comp = uuidComponentMap.get(key);
    Log.logInfo(this, "Added '" + comp + "' to mappingData.");
    mappingData.addFunctionComponent(comp);
  }
}

/**
 * Remove all elements from the collection (optional operation). This implementation obtains an
 * iterator over the collection and calls next and remove on it repeatedly (thus this method will
 * fail with an UnsupportedOperationException if the Iterator's remove method does) until there
 * are no more elements to remove. Many implementations will have a faster way of doing this.
 *
 * @throws UnsupportedOperationException if the Iterator returned by iterator does not provide an
 *     implementation of remove
 * @see Iterator#remove()
 */
public void clear() {
  Iterator itr = iterator();
  int pos = size();
  while (--pos >= 0) {
    itr.next();
    itr.remove();
  }
}

/** Adds all Sequences in the collection to this SequenceList. */
public boolean addAll(Collection c) {
  Iterator i = c.iterator();
  boolean changed = false;

  while (i.hasNext()) {
    Sequence seq = (Sequence) i.next();

    if (add(seq)) changed = true;
  }

  if (changed) {
    sortedBy = SORT_UNSORTED;
    modified();
  }

  return changed;
}

