/**
 * Run the maintenance thread. Every REFRESH seconds, re-register this app server as alive in
 * the cluster. Then check for any cluster entries that are more than EXPIRED seconds old,
 * indicating a failed app server, and remove that record, that server's sessions, generating
 * appropriate session events so the other app servers know what's going on. The "then" checks
 * need not be done each iteration - run them on 1 of n randomly choosen iterations. In a
 * clustered environment, this also distributes the work over the cluster better.
 */
public void run() {
  // wait till things are rolling
  ComponentManager.waitTillConfigured();

  if (M_log.isDebugEnabled()) M_log.debug("run()");

  while (!m_maintenanceCheckerStop) {
    try {
      final String serverIdInstance = m_serverConfigurationService.getServerIdInstance();

      if (M_log.isDebugEnabled()) M_log.debug("checking...");

      // if we have been closed, reopen!
      String statement = clusterServiceSql.getReadServerSql();
      Object[] fields = new Object[1];
      fields[0] = serverIdInstance;
      List results = m_sqlService.dbRead(statement, fields, null);
      if (results.isEmpty()) {
        M_log.warn(
            "run(): server has been closed in cluster table, reopened: " + serverIdInstance);

        statement = clusterServiceSql.getInsertServerSql();
        fields[0] = serverIdInstance;
        boolean ok = m_sqlService.dbWrite(statement, fields);
        if (!ok) {
          M_log.warn("start(): dbWrite failed");
        }
      }

      // update our alive and well status
      else {
        // register that this app server is alive and well
        statement = clusterServiceSql.getUpdateServerSql();
        fields[0] = serverIdInstance;
        boolean ok = m_sqlService.dbWrite(statement, fields);
        if (!ok) {
          M_log.warn("run(): dbWrite failed: " + statement);
        }
      }

      // pick a random number, 0..99, to see if we want to do the full ghosting / cleanup
      // activities now
      int rand = (int) (Math.random() * 100.0);
      if (rand < m_ghostingPercent) {
        // get all expired open app servers not me
        statement = clusterServiceSql.getListExpiredServers(m_expired);
        // setup the fields to skip reading me!
        fields[0] = serverIdInstance;

        List instances = m_sqlService.dbRead(statement, fields, null);

        // close any severs found to be expired
        for (Iterator iInstances = instances.iterator(); iInstances.hasNext(); ) {
          String serverId = (String) iInstances.next();

          // close the server - delete the record
          statement = clusterServiceSql.getDeleteServerSql();
          fields[0] = serverId;
          boolean ok = m_sqlService.dbWrite(statement, fields);
          if (!ok) {
            M_log.warn("run(): dbWrite failed: " + statement);
          }

          M_log.warn(
              "run(): ghost-busting server: " + serverId + " from : " + serverIdInstance);
        }

        // Close all sessions left over from deleted servers.
        int nbrClosed = m_usageSessionService.closeSessionsOnInvalidServers(getServers());
        if ((nbrClosed > 0) && M_log.isInfoEnabled())
          M_log.info("Closed " + nbrClosed + " orphaned usage session records");

        // Delete any orphaned locks from closed or missing sessions.
        statement = clusterServiceSql.getOrphanedLockSessionsSql();
        List sessions = m_sqlService.dbRead(statement);
        if (sessions.size() > 0) {
          if (M_log.isInfoEnabled())
            M_log.info(
                "Found " + sessions.size() + " closed or deleted sessions in lock table");
          statement = clusterServiceSql.getDeleteLocksSql();
          for (Iterator iSessions = sessions.iterator(); iSessions.hasNext(); ) {
            fields[0] = (String) iSessions.next();
            boolean ok = m_sqlService.dbWrite(statement, fields);
            if (!ok) {
              M_log.warn("run(): dbWrite failed: " + statement);
            }
          }
        }
      }
    } catch (Throwable e) {
      M_log.warn("exception: ", e);
    } finally {
      // clear out any current access bindings
      m_threadLocalManager.clear();
    }

    // cycle every REFRESH seconds
    if (!m_maintenanceCheckerStop) {
      try {
        Thread.sleep(m_refresh * 1000L);
      } catch (Exception ignore) {
      }
    }
  }

  if (M_log.isDebugEnabled()) M_log.debug("done");
}

/**
 * @param problems
 * @return IStatus
 * @since 4.3
 */
private IStatus createFinalResultStatus(List problems) {

  IStatus resultStatus = null;
  int numErrors = 0;
  int numWarnings = 0;
  final Iterator problemIter = problems.iterator();

  while (problemIter.hasNext()) {
    final IStatus aStatus = (IStatus) problemIter.next();
    if (aStatus.getSeverity() == IStatus.WARNING) {
      ++numWarnings;
    } else if (aStatus.getSeverity() == IStatus.ERROR) {
      ++numErrors;
    }
  }

  // Create the final status ...
  final IStatus[] statusArray = (IStatus[]) problems.toArray(new IStatus[problems.size()]);
  if (numWarnings != 0 && numErrors == 0) {
    final int code = EXECUTE_WITH_WARNINGS;
    final Object[] params = new Object[] {new Integer(numWarnings)};
    final String msg =
        ModelerCore.Util.getString("OrganizeImportCommand.warnings", params); // $NON-NLS-1$
    resultStatus = new MultiStatus(PLUGINID, code, statusArray, msg, null);
  } else if (numWarnings == 0 && numErrors != 0) {
    final int code = EXECUTE_WITH_ERRORS;
    final Object[] params = new Object[] {new Integer(numErrors)};
    final String msg =
        ModelerCore.Util.getString("OrganizeImportCommand.errors", params); // $NON-NLS-1$
    resultStatus = new MultiStatus(PLUGINID, code, statusArray, msg, null);
  } else if (numWarnings != 0 && numErrors != 0) {
    final int code = EXECUTE_WITH_WARNINGS_AND_ERRORS;
    final Object[] params = new Object[] {new Integer(numWarnings), new Integer(numErrors)};
    final String msg =
        ModelerCore.Util.getString(
            "OrganizeImportCommand.warnings_and_errors", params); // $NON-NLS-1$
    resultStatus = new MultiStatus(PLUGINID, code, statusArray, msg, null);
  } else {
    final int code = EXECUTE_WITH_NO_WARNINGS_AND_ERRORS;
    final String msg =
        ModelerCore.Util.getString("OrganizeImportCommand.no_warnings_or_errors"); // $NON-NLS-1$
    resultStatus = new MultiStatus(PLUGINID, code, statusArray, msg, null);
  }

  return resultStatus;
}

/** For GWP Promotions with multiple alternatives, selects an alternative to the current GWP */
public static String setDesiredAlternateGwpProductId(
    HttpServletRequest request, HttpServletResponse response) {
  ShoppingCart cart = getCartObject(request);
  Delegator delegator = (Delegator) request.getAttribute("delegator");
  LocalDispatcher dispatcher = (LocalDispatcher) request.getAttribute("dispatcher");
  String alternateGwpProductId = request.getParameter("alternateGwpProductId");
  String alternateGwpLineStr = request.getParameter("alternateGwpLine");
  Locale locale = UtilHttp.getLocale(request);

  if (UtilValidate.isEmpty(alternateGwpProductId)) {
    request.setAttribute(
        "_ERROR_MESSAGE_",
        UtilProperties.getMessage(
            resource_error,
            "OrderCouldNotSelectAlternateGiftNoAlternateGwpProductIdPassed",
            locale));
    return "error";
  }
  if (UtilValidate.isEmpty(alternateGwpLineStr)) {
    request.setAttribute(
        "_ERROR_MESSAGE_",
        UtilProperties.getMessage(
            resource_error, "OrderCouldNotSelectAlternateGiftNoAlternateGwpLinePassed", locale));
    return "error";
  }

  int alternateGwpLine = 0;
  try {
    alternateGwpLine = Integer.parseInt(alternateGwpLineStr);
  } catch (Exception e) {
    request.setAttribute(
        "_ERROR_MESSAGE_",
        UtilProperties.getMessage(
            resource_error,
            "OrderCouldNotSelectAlternateGiftAlternateGwpLineIsNotAValidNumber",
            locale));
    return "error";
  }

  ShoppingCartItem cartLine = cart.findCartItem(alternateGwpLine);
  if (cartLine == null) {
    request.setAttribute(
        "_ERROR_MESSAGE_",
        "Could not select alternate gift, no cart line item found for #"
            + alternateGwpLine
            + ".");
    return "error";
  }

  if (cartLine.getIsPromo()) {
    // note that there should just be one promo adjustment, the reversal of the GWP, so use that
    // to get the promo action key
    Iterator checkOrderAdjustments = UtilMisc.toIterator(cartLine.getAdjustments());
    while (checkOrderAdjustments != null && checkOrderAdjustments.hasNext()) {
      GenericValue checkOrderAdjustment = (GenericValue) checkOrderAdjustments.next();
      if (UtilValidate.isNotEmpty(checkOrderAdjustment.getString("productPromoId"))
          && UtilValidate.isNotEmpty(checkOrderAdjustment.getString("productPromoRuleId"))
          && UtilValidate.isNotEmpty(checkOrderAdjustment.getString("productPromoActionSeqId"))) {
        GenericPK productPromoActionPk =
            delegator.makeValidValue("ProductPromoAction", checkOrderAdjustment).getPrimaryKey();
        cart.setDesiredAlternateGiftByAction(productPromoActionPk, alternateGwpProductId);
        if (cart.getOrderType().equals("SALES_ORDER")) {
          org.ofbiz.order.shoppingcart.product.ProductPromoWorker.doPromotions(cart, dispatcher);
        }
        return "success";
      }
    }
  }

  request.setAttribute(
      "_ERROR_MESSAGE_",
      "Could not select alternate gift, cart line item found for #"
          + alternateGwpLine
          + " does not appear to be a valid promotional gift.");
  return "error";
}

