/**
 * To compute the summary label for a side, the algorithm is: FOR all edges IF any edge's location
 * is INTERIOR for the side, side location = INTERIOR ELSE IF there is at least one EXTERIOR
 * attribute, side location = EXTERIOR ELSE side location = NULL <br>
 * Note that it is possible for two sides to have apparently contradictory information i.e. one
 * edge side may indicate that it is in the interior of a geometry, while another edge side may
 * indicate the exterior of the same geometry. This is not an incompatibility -
 * GeometryCollections may contain two Polygons that touch along an edge. This is the reason for
 * Interior-primacy rule above - it results in the summary label having the Geometry interior on
 * <b>both</b> sides.
 *
 * @param geomIndex
 * @param side
 */
private void computeLabelSide(int geomIndex, int side) {
  for (Iterator it = iterator(); it.hasNext(); ) {
    EdgeEnd e = (EdgeEnd) it.next();
    if (e.getLabel().isArea()) {
      int loc = e.getLabel().getLocation(geomIndex, side);
      if (loc == Location.INTERIOR) {
        label.setLocation(geomIndex, side, Location.INTERIOR);
        return;
      } else if (loc == Location.EXTERIOR) label.setLocation(geomIndex, side, Location.EXTERIOR);
    }
  }
}

/**
 * Returns the Map of consent responses for given collection protocol.
 *
 * @param consentResponse : consentResponse
 * @param isMapExist : isMapExist
 * @return Map : Map
 */
private Map getConsentResponseMap(Collection consentResponse, boolean isMapExist) {
  final Map consentResponseMap = new LinkedHashMap();
  final Set consentResponseMapSorted = new LinkedHashSet();
  // bug 8905
  final List idList = new ArrayList();
  idList.addAll(consentResponse);
  Collections.sort(idList, new IdComparator());
  consentResponseMapSorted.addAll(idList);
  // bug 8905
  if (consentResponseMapSorted != null) {
    int i = 0;
    final Iterator consentResponseIter = consentResponseMapSorted.iterator();
    String idKey = null;
    String statementKey = null;
    String responsekey = null;
    String participantResponceIdKey = null;
    while (consentResponseIter.hasNext()) {
      idKey = "ConsentBean:" + i + "_consentTierID";
      statementKey = "ConsentBean:" + i + "_statement";
      responsekey = "ConsentBean:" + i + "_participantResponse";
      participantResponceIdKey = "ConsentBean:" + i + "_participantResponseID";

      if (isMapExist) {
        final ConsentBean consentBean = (ConsentBean) consentResponseIter.next();
        consentResponseMap.put(idKey, consentBean.getConsentTierID());
        consentResponseMap.put(statementKey, consentBean.getStatement());
        consentResponseMap.put(responsekey, consentBean.getParticipantResponse());
        consentResponseMap.put(participantResponceIdKey, consentBean.getParticipantResponseID());
      } else {
        final ConsentTier consent = (ConsentTier) consentResponseIter.next();
        consentResponseMap.put(idKey, consent.getId());
        consentResponseMap.put(statementKey, consent.getStatement());
        consentResponseMap.put(responsekey, "");
        consentResponseMap.put(participantResponceIdKey, "");
      }
      i++;
    }

    this.consentCounter = i;
  }
  return consentResponseMap;
}

/**
 * Determine if a String is contained in a String Collection
 *
 * @param stringCollection The collection of (String) to scan
 * @param value The value to look for
 * @return true if the string was found
 */
public static boolean contains(Collection stringCollection, String value) {
  if (stringCollection == null || value == null) return false;
  if (value.length() == 0) return false;
  for (Iterator i = stringCollection.iterator(); i.hasNext(); ) {
    Object o = i.next();
    if (!(o instanceof String)) continue;
    if (value.equals((String) o)) return true;
  }
  return false;
}

