protected void htmlTableForInstructionalOfferings(
    SessionContext context,
    ClassAssignmentProxy classAssignment,
    ExamAssignmentProxy examAssignment,
    TreeSet insructionalOfferings,
    Long subjectAreaId,
    boolean displayHeader,
    boolean allCoursesAreGiven,
    JspWriter outputStream,
    Comparator classComparator) {

  if (classComparator != null) setClassComparator(classComparator);

  if (isShowTimetable()) {
    boolean hasTimetable = false;
    if (context.hasPermission(null, "Department", Right.ClassAssignments)
        && classAssignment != null) {
      try {
        if (classAssignment instanceof CachedClassAssignmentProxy) {
          Vector allClasses = new Vector();
          for (Iterator i = insructionalOfferings.iterator(); !hasTimetable && i.hasNext(); ) {
            InstructionalOffering io = (InstructionalOffering) i.next();
            for (Iterator j = io.getInstrOfferingConfigs().iterator();
                !hasTimetable && j.hasNext(); ) {
              InstrOfferingConfig ioc = (InstrOfferingConfig) j.next();
              for (Iterator k = ioc.getSchedulingSubparts().iterator();
                  !hasTimetable && k.hasNext(); ) {
                SchedulingSubpart ss = (SchedulingSubpart) k.next();
                for (Iterator l = ss.getClasses().iterator(); l.hasNext(); ) {
                  Class_ clazz = (Class_) l.next();
                  allClasses.add(clazz);
                }
              }
            }
          }
          ((CachedClassAssignmentProxy) classAssignment).setCache(allClasses);
          hasTimetable = !classAssignment.getAssignmentTable(allClasses).isEmpty();
        } else {
          for (Iterator i = insructionalOfferings.iterator(); !hasTimetable && i.hasNext(); ) {
            InstructionalOffering io = (InstructionalOffering) i.next();
            for (Iterator j = io.getInstrOfferingConfigs().iterator();
                !hasTimetable && j.hasNext(); ) {
              InstrOfferingConfig ioc = (InstrOfferingConfig) j.next();
              for (Iterator k = ioc.getSchedulingSubparts().iterator();
                  !hasTimetable && k.hasNext(); ) {
                SchedulingSubpart ss = (SchedulingSubpart) k.next();
                for (Iterator l = ss.getClasses().iterator(); l.hasNext(); ) {
                  Class_ clazz = (Class_) l.next();
                  if (classAssignment.getAssignment(clazz) != null) {
                    hasTimetable = true;
                    break;
                  }
                }
              }
            }
          }
        }
      } catch (Exception e) {
      }
    }
    setDisplayTimetable(hasTimetable);
  }

  if (isShowExam())
    setShowExamTimetable(
        examAssignment != null
            || Exam.hasTimetable(context.getUser().getCurrentAcademicSessionId()));

  ArrayList notOfferedOfferings = new ArrayList();
  ArrayList offeredOfferings = new ArrayList();
  ArrayList offeringIds = new ArrayList();

  Iterator it = insructionalOfferings.iterator();
  InstructionalOffering io = null;
  boolean hasOfferedCourses = false;
  boolean hasNotOfferedCourses = false;
  setUserSettings(context.getUser());

  while (it.hasNext()) {
    io = (InstructionalOffering) it.next();
    if (io.isNotOffered() == null || io.isNotOffered().booleanValue()) {
      hasNotOfferedCourses = true;
      notOfferedOfferings.add(io);
    } else {
      hasOfferedCourses = true;
      offeredOfferings.add(io);
    }
  }

  if (hasOfferedCourses || allCoursesAreGiven) {
    if (displayHeader) {
      try {
        if (allCoursesAreGiven)
          outputStream.print(
              "<DIV align=\"right\"><A class=\"l7\" href=\"#notOffered\">"
                  + MSG.labelNotOfferedCourses()
                  + "</A></DIV>");
        outputStream.print(
            "<DIV class=\"WelcomeRowHead\"><A name=\"offered\"></A>"
                + MSG.labelOfferedCourses()
                + "</DIV>");
      } catch (IOException e) {
        e.printStackTrace();
      }
    }

    if (hasOfferedCourses) {
      it = offeredOfferings.iterator();
      TableStream offeredTable =
          this.initTable(outputStream, context.getUser().getCurrentAcademicSessionId());

      while (it.hasNext()) {
        io = (InstructionalOffering) it.next();
        offeringIds.add(io.getUniqueId());
        this.addInstrOffrRowsToTable(
            classAssignment, examAssignment, offeredTable, io, subjectAreaId, context);
      }
      offeredTable.tableComplete();
    } else {
      if (displayHeader)
        try {
          outputStream.print("<font class=\"error\">" + MSG.errorNoCoursesOffered() + "</font>");
        } catch (IOException e) {
          e.printStackTrace();
        }
    }
  }

  if (hasNotOfferedCourses || allCoursesAreGiven) {
    if (displayHeader) {
      try {
        outputStream.print("<br>");
        if (allCoursesAreGiven)
          outputStream.print(
              "<DIV align=\"right\"><A class=\"l7\" href=\"#offered\">"
                  + MSG.labelOfferedCourses()
                  + "</A></DIV>");
        outputStream.print(
            "<DIV class=\"WelcomeRowHead\"><A name=\"notOffered\"></A>"
                + MSG.labelNotOfferedCourses()
                + "</DIV>");
      } catch (IOException e) {
        e.printStackTrace();
      }
    }

    if (hasNotOfferedCourses) {
      it = notOfferedOfferings.iterator();
      TableStream notOfferedTable =
          this.initTable(outputStream, context.getUser().getCurrentAcademicSessionId());
      while (it.hasNext()) {
        io = (InstructionalOffering) it.next();
        offeringIds.add(io.getUniqueId());
        this.addInstrOffrRowsToTable(
            classAssignment, examAssignment, notOfferedTable, io, subjectAreaId, context);
      }
      notOfferedTable.tableComplete();
    } else {
      if (displayHeader)
        try {
          outputStream.print(
              "<font class=\"normal\">&nbsp;<br>" + MSG.errorAllCoursesOffered() + "</font>");
        } catch (IOException e) {
          e.printStackTrace();
        }
    }
  }

  Navigation.set(context, Navigation.sInstructionalOfferingLevel, offeringIds);
}

public void onCommit(List commits) throws IOException {
  IndexCommitPoint lastCommit = (IndexCommitPoint) commits.get(commits.size() - 1);

  // Any commit older than expireTime should be deleted:
  double expireTime =
      dir.fileModified(lastCommit.getSegmentsFileName()) / 1000.0 - expirationTimeSeconds;

  Iterator it = commits.iterator();

  while (it.hasNext()) {
    IndexCommitPoint commit = (IndexCommitPoint) it.next();
    double modTime = dir.fileModified(commit.getSegmentsFileName()) / 1000.0;
    if (commit != lastCommit && modTime < expireTime) {
      commit.delete();
    }
  }
}

private void destroyImages(List<Image> images) {
  Iterator<Image> iter = images.iterator();
  while (iter.hasNext()) {
    Image image = iter.next();
    if (image != null && !image.isDisposed()) image.dispose();
  }
}

private void addFiles(
    StudyVersion studyVersion,
    List<StudyFileEditBean> newFiles,
    VDCUser user,
    String ingestEmail,
    int messageLevel) {

  Study study = studyVersion.getStudy();

  // step 1: divide the files, based on subsettable or not
  List subsettableFiles = new ArrayList();
  List otherFiles = new ArrayList();

  Iterator iter = newFiles.iterator();
  while (iter.hasNext()) {
    StudyFileEditBean fileBean = (StudyFileEditBean) iter.next();
    if (fileBean.getStudyFile().isSubsettable()) {
      subsettableFiles.add(fileBean);
    } else {
      otherFiles.add(fileBean);
      // also add to study, so that it will be flushed for the ids
      fileBean.getStudyFile().setStudy(study);
      study.getStudyFiles().add(fileBean.getStudyFile());
    }
  }

  if (otherFiles.size() > 0) {
    // Only persist the studyVersion we are adding a file that doesn't need to be ingested
    // (non-subsettable)
    if (studyVersion.getId() == null) {
      em.persist(studyVersion);
      em.flush(); // populates studyVersion_id
    } else {
      // There is a problem merging the existing studyVersion,
      // so since all we need from the exisiting version is the versionNote,
      // we get a fresh copy of the object from the database, and update it with the versionNote.
      String versionNote = studyVersion.getVersionNote();
      studyVersion = em.find(StudyVersion.class, studyVersion.getId());
      studyVersion.setVersionNote(versionNote);
    }
  }

  // step 2: iterate through nonsubsettable files, moving from temp to new location
  File newDir = FileUtil.getStudyFileDir(study);
  iter = otherFiles.iterator();
  while (iter.hasNext()) {
    StudyFileEditBean fileBean = (StudyFileEditBean) iter.next();
    StudyFile f = fileBean.getStudyFile();
    File tempFile = new File(fileBean.getTempSystemFileLocation());
    File newLocationFile = new File(newDir, f.getFileSystemName());
    try {
      FileUtil.copyFile(tempFile, newLocationFile);
      tempFile.delete();
      f.setFileSystemLocation(newLocationFile.getAbsolutePath());

      fileBean.getFileMetadata().setStudyVersion(studyVersion);

      em.persist(fileBean.getStudyFile());
      em.persist(fileBean.getFileMetadata());

    } catch (IOException ex) {
      throw new EJBException(ex);
    }
  }

  // step 3: iterate through subsettable files, sending a message via JMS
  if (subsettableFiles.size() > 0) {
    QueueConnection conn = null;
    QueueSession session = null;
    QueueSender sender = null;
    try {
      conn = factory.createQueueConnection();
      session = conn.createQueueSession(false, 0);
      sender = session.createSender(queue);

      DSBIngestMessage ingestMessage = new DSBIngestMessage(messageLevel);
      ingestMessage.setFileBeans(subsettableFiles);
      ingestMessage.setIngestEmail(ingestEmail);
      ingestMessage.setIngestUserId(user.getId());
      ingestMessage.setStudyId(study.getId());
      ingestMessage.setStudyVersionId(studyVersion.getId());
      ingestMessage.setVersionNote(studyVersion.getVersionNote());
      Message message = session.createObjectMessage(ingestMessage);

      String detail = "Ingest processing for " + subsettableFiles.size() + " file(s).";
      studyService.addStudyLock(study.getId(), user.getId(), detail);
      try {
        sender.send(message);
      } catch (Exception ex) {
        // If anything goes wrong, remove the study lock.
        studyService.removeStudyLock(study.getId());
        ex.printStackTrace();
      }

      // send an e-mail
      if (ingestMessage.sendInfoMessage()) {
        mailService.sendIngestRequestedNotification(ingestEmail, subsettableFiles);
      }

    } catch (JMSException ex) {
      ex.printStackTrace();
    } finally {
      try {

        if (sender != null) {
          sender.close();
        }
        if (session != null) {
          session.close();
        }
        if (conn != null) {
          conn.close();
        }
      } catch (JMSException ex) {
        ex.printStackTrace();
      }
    }
  }

  if (!otherFiles.isEmpty()) {
    studyService.saveStudyVersion(studyVersion, user.getId());
  }
}

protected void process(Document document) throws Exception {
  // perform XPath
  if (verbose) {
    println("About to evalute: " + xpath);
    println("Results:");
  }

  Object object = xpath.evaluate(document);

  if (object instanceof List) {
    List list = (List) object;
    for (Iterator iter = list.iterator(); iter.hasNext(); ) {
      getXMLWriter().write(iter.next());
      getXMLWriter().println();
    }
    getXMLWriter().flush();
  } else {
    println((object != null) ? object.toString() : "null");
  }
}

/**
 * This method uses the passed-in XMLInputSource to make fCurrentEntity usable for reading.
 *
 * @param name name of the entity (XML is it's the document entity)
 * @param xmlInputSource the input source, with sufficient information to begin scanning
 *     characters.
 * @param literal True if this entity is started within a literal value.
 * @param isExternal whether this entity should be treated as an internal or external entity.
 * @throws IOException if anything can't be read XNIException If any parser-specific goes wrong.
 * @return the encoding of the new entity or null if a character stream was employed
 */
public String setupCurrentEntity(
    String name, XMLInputSource xmlInputSource, boolean literal, boolean isExternal)
    throws IOException, XNIException {
  // get information

  final String publicId = xmlInputSource.getPublicId();
  String literalSystemId = xmlInputSource.getSystemId();
  String baseSystemId = xmlInputSource.getBaseSystemId();
  String encoding = xmlInputSource.getEncoding();
  final boolean encodingExternallySpecified = (encoding != null);
  Boolean isBigEndian = null;

  // create reader
  InputStream stream = null;
  Reader reader = xmlInputSource.getCharacterStream();

  // First chance checking strict URI
  String expandedSystemId = expandSystemId(literalSystemId, baseSystemId, fStrictURI);
  if (baseSystemId == null) {
    baseSystemId = expandedSystemId;
  }
  if (reader == null) {
    stream = xmlInputSource.getByteStream();
    if (stream == null) {
      URL location = new URL(expandedSystemId);
      URLConnection connect = location.openConnection();
      if (!(connect instanceof HttpURLConnection)) {
        stream = connect.getInputStream();
      } else {
        boolean followRedirects = true;

        // setup URLConnection if we have an HTTPInputSource
        if (xmlInputSource instanceof HTTPInputSource) {
          final HttpURLConnection urlConnection = (HttpURLConnection) connect;
          final HTTPInputSource httpInputSource = (HTTPInputSource) xmlInputSource;

          // set request properties
          Iterator propIter = httpInputSource.getHTTPRequestProperties();
          while (propIter.hasNext()) {
            Map.Entry entry = (Map.Entry) propIter.next();
            urlConnection.setRequestProperty((String) entry.getKey(), (String) entry.getValue());
          }

          // set preference for redirection
          followRedirects = httpInputSource.getFollowHTTPRedirects();
          if (!followRedirects) {
            setInstanceFollowRedirects(urlConnection, followRedirects);
          }
        }

        stream = connect.getInputStream();

        // REVISIT: If the URLConnection has external encoding
        // information, we should be reading it here. It's located
        // in the charset parameter of Content-Type. -- mrglavas

        if (followRedirects) {
          String redirect = connect.getURL().toString();
          // E43: Check if the URL was redirected, and then
          // update literal and expanded system IDs if needed.
          if (!redirect.equals(expandedSystemId)) {
            literalSystemId = redirect;
            expandedSystemId = redirect;
          }
        }
      }
    }

    // wrap this stream in RewindableInputStream
    stream = new RewindableInputStream(stream);

    // perform auto-detect of encoding if necessary
    if (encoding == null) {
      // read first four bytes and determine encoding
      final byte[] b4 = new byte[4];
      int count = 0;
      for (; count < 4; count++) {
        b4[count] = (byte) stream.read();
      }
      if (count == 4) {
        Object[] encodingDesc = getEncodingName(b4, count);
        encoding = (String) (encodingDesc[0]);
        isBigEndian = (Boolean) (encodingDesc[1]);

        stream.reset();
        // Special case UTF-8 files with BOM created by Microsoft
        // tools. It's more efficient to consume the BOM than make
        // the reader perform extra checks. -Ac
        if (count > 2 && encoding.equals("UTF-8")) {
          int b0 = b4[0] & 0xFF;
          int b1 = b4[1] & 0xFF;
          int b2 = b4[2] & 0xFF;
          if (b0 == 0xEF && b1 == 0xBB && b2 == 0xBF) {
            // ignore first three bytes...
            stream.skip(3);
          }
        }
        reader = createReader(stream, encoding, isBigEndian);
      } else {
        reader = createReader(stream, encoding, isBigEndian);
      }
    }

    // use specified encoding
    else {
      encoding = encoding.toUpperCase(Locale.ENGLISH);

      // If encoding is UTF-8, consume BOM if one is present.
      if (encoding.equals("UTF-8")) {
        final int[] b3 = new int[3];
        int count = 0;
        for (; count < 3; ++count) {
          b3[count] = stream.read();
          if (b3[count] == -1) break;
        }
        if (count == 3) {
          if (b3[0] != 0xEF || b3[1] != 0xBB || b3[2] != 0xBF) {
            // First three bytes are not BOM, so reset.
            stream.reset();
          }
        } else {
          stream.reset();
        }
      }
      // If encoding is UTF-16, we still need to read the first four bytes
      // in order to discover the byte order.
      else if (encoding.equals("UTF-16")) {
        final int[] b4 = new int[4];
        int count = 0;
        for (; count < 4; ++count) {
          b4[count] = stream.read();
          if (b4[count] == -1) break;
        }
        stream.reset();

        String utf16Encoding = "UTF-16";
        if (count >= 2) {
          final int b0 = b4[0];
          final int b1 = b4[1];
          if (b0 == 0xFE && b1 == 0xFF) {
            // UTF-16, big-endian
            utf16Encoding = "UTF-16BE";
            isBigEndian = Boolean.TRUE;
          } else if (b0 == 0xFF && b1 == 0xFE) {
            // UTF-16, little-endian
            utf16Encoding = "UTF-16LE";
            isBigEndian = Boolean.FALSE;
          } else if (count == 4) {
            final int b2 = b4[2];
            final int b3 = b4[3];
            if (b0 == 0x00 && b1 == 0x3C && b2 == 0x00 && b3 == 0x3F) {
              // UTF-16, big-endian, no BOM
              utf16Encoding = "UTF-16BE";
              isBigEndian = Boolean.TRUE;
            }
            if (b0 == 0x3C && b1 == 0x00 && b2 == 0x3F && b3 == 0x00) {
              // UTF-16, little-endian, no BOM
              utf16Encoding = "UTF-16LE";
              isBigEndian = Boolean.FALSE;
            }
          }
        }
        reader = createReader(stream, utf16Encoding, isBigEndian);
      }
      // If encoding is UCS-4, we still need to read the first four bytes
      // in order to discover the byte order.
      else if (encoding.equals("ISO-10646-UCS-4")) {
        final int[] b4 = new int[4];
        int count = 0;
        for (; count < 4; ++count) {
          b4[count] = stream.read();
          if (b4[count] == -1) break;
        }
        stream.reset();

        // Ignore unusual octet order for now.
        if (count == 4) {
          // UCS-4, big endian (1234)
          if (b4[0] == 0x00 && b4[1] == 0x00 && b4[2] == 0x00 && b4[3] == 0x3C) {
            isBigEndian = Boolean.TRUE;
          }
          // UCS-4, little endian (1234)
          else if (b4[0] == 0x3C && b4[1] == 0x00 && b4[2] == 0x00 && b4[3] == 0x00) {
            isBigEndian = Boolean.FALSE;
          }
        }
      }
      // If encoding is UCS-2, we still need to read the first four bytes
      // in order to discover the byte order.
      else if (encoding.equals("ISO-10646-UCS-2")) {
        final int[] b4 = new int[4];
        int count = 0;
        for (; count < 4; ++count) {
          b4[count] = stream.read();
          if (b4[count] == -1) break;
        }
        stream.reset();

        if (count == 4) {
          // UCS-2, big endian
          if (b4[0] == 0x00 && b4[1] == 0x3C && b4[2] == 0x00 && b4[3] == 0x3F) {
            isBigEndian = Boolean.TRUE;
          }
          // UCS-2, little endian
          else if (b4[0] == 0x3C && b4[1] == 0x00 && b4[2] == 0x3F && b4[3] == 0x00) {
            isBigEndian = Boolean.FALSE;
          }
        }
      }

      reader = createReader(stream, encoding, isBigEndian);
    }

    // read one character at a time so we don't jump too far
    // ahead, converting characters from the byte stream in
    // the wrong encoding
    if (DEBUG_ENCODINGS) {
      System.out.println("$$$ no longer wrapping reader in OneCharReader");
    }
    // reader = new OneCharReader(reader);
  }

  // We've seen a new Reader.
  // Push it on the stack so we can close it later.
  // fOwnReaders.add(reader);

  // push entity on stack
  if (fCurrentEntity != null) {
    fEntityStack.push(fCurrentEntity);
  }

  // create entity
  /* if encoding is specified externally, 'encoding' information present
   * in the prolog of the XML document is not considered. Hence, prolog can
   * be read in Chunks of data instead of byte by byte.
   */
  fCurrentEntity =
      new com.sun.xml.internal.stream.Entity.ScannedEntity(
          name,
          new XMLResourceIdentifierImpl(
              publicId, literalSystemId, baseSystemId, expandedSystemId),
          stream,
          reader,
          encoding,
          literal,
          encodingExternallySpecified,
          isExternal);
  fCurrentEntity.setEncodingExternallySpecified(encodingExternallySpecified);
  fEntityScanner.setCurrentEntity(fCurrentEntity);
  fResourceIdentifier.setValues(publicId, literalSystemId, baseSystemId, expandedSystemId);
  return encoding;
} // setupCurrentEntity(String, XMLInputSource, boolean, boolean): String

