/**
 * Looks up the element handlers to be used for each element
 *
 * @param group
 * @return
 */
private Map gatherElementHandlers(FeatureMap group) throws WFSTransactionException {
  // JD: use a linked hashmap since the order of elements in a transaction
  // must be respected
  Map map = new LinkedHashMap();

  for (Iterator it = group.iterator(); it.hasNext(); ) {
    FeatureMap.Entry entry = (FeatureMap.Entry) it.next();
    EObject element = (EObject) entry.getValue();
    map.put(element, findElementHandler(element.getClass()));
  }

  return map;
}

/**
 * Remove a notification event listener from this MBean.
 *
 * @param listener The listener to be removed (any and all registrations for this listener will be
 *     eliminated)
 * @exception ListenerNotFoundException if this listener is not registered in the MBean
 */
public void removeNotificationListener(NotificationListener listener)
    throws ListenerNotFoundException {

  synchronized (entries) {
    Iterator items = entries.iterator();
    while (items.hasNext()) {
      BaseNotificationBroadcasterEntry item = (BaseNotificationBroadcasterEntry) items.next();
      if (item.listener == listener) items.remove();
    }
  }
}

private void finishCreateMappingClass(
    EObject location, MappingClass mappingClass, boolean moveParentAttributes) {

  if (mappingClass != null) {

    if (moveParentAttributes) {

      Collection documentNodes = getMappingClassExtentNodes(mappingClass);
      Collection mappableDocumentNodes = new ArrayList(documentNodes.size() + 1);

      // first, see if this node itself is mappable
      if (mapper.isMappable(location)) {
        // make or move a mapping attribute for this attribute
        mappableDocumentNodes.add(location);
      }

      // next, gather all mappable nodes in the coarse extent
      Iterator iter = documentNodes.iterator();
      while (iter.hasNext()) {
        EObject docNode = (EObject) iter.next();
        if (mapper.isMappable(docNode) && !mappableDocumentNodes.contains(docNode)) {
          mappableDocumentNodes.add(docNode);
        }
      }

      // finally, move or create the attributes, as appropriate
      if (!mappableDocumentNodes.isEmpty()) {
        moveOrCreateMappingClassColumns(
            mappingClass, mappableDocumentNodes, new HashMap(), true, new HashSet());
      }
    }
  }
}

private List toList(PSelectClause p) throws ParserException {
  if (p instanceof AAllSelectClause) {
    return null;
  } else if (p instanceof ASomeSelectClause) {
    ASomeSelectClause selectClause = (ASomeSelectClause) p;
    List list = new LinkedList();
    list.add(toVariable(selectClause.getVar()));
    for (Iterator i = selectClause.getSelectTail().iterator(); i.hasNext(); ) {
      list.add(toVariable(((ASelectTail) i.next()).getVar()));
    }
    return list;
  } else {
    throw new Error("Unhandled PSelectClause subtype " + p.getClass());
  }
}

/**
 * Halts this context. The calling thread will be blocked until a lock on the context has been
 * acquired and no more threads are running under this context. Nothing will be done if the
 * servlet is already halted.
 *
 * @return true if and only if this context is not halted or being halted.
 */
public synchronized boolean halt() {
  if (!halted) {
    Sys.main.log.info(this.getClass().getName() + " is being halted");
    halted = true;
    haltRequested = true;

    while (threadCount > 0) {
      try {
        wait();
      } catch (Exception e) {
      }
    }

    Iterator listeners = contextListeners.iterator();
    while (listeners.hasNext()) {
      StatefulServletContextListener listener = (StatefulServletContextListener) listeners.next();
      try {
        listener.servletContextHalted();
      } catch (Exception e) {
        Sys.main.log.error(
            "Error in invoking listener '"
                + listener.getClass().getName()
                + "' after context halted",
            e);
      }
    }

    haltRequested = false;
    Sys.main.log.info(this.getClass().getName() + " has been halted");
    return true;
  } else {
    return false;
  }
}

