/**
 * Services a Commandline Request.
 *
 * @param rc Request Context.
 * @throw CLIException if the request cannot serviced.
 */
public void handleRequest(RequestContext rc) throws CLIException {
  super.handleRequest(rc);
  ldapLogin();

  SSOToken adminSSOToken = getAdminSSOToken();
  String realm = getStringOptionValue(IArgument.REALM_NAME);
  List agentNames = (List) rc.getOption(IArgument.AGENT_NAMES);
  String file = getStringOptionValue(IArgument.FILE);
  if (agentNames == null) {
    agentNames = new ArrayList();
  }

  if (file != null) {
    agentNames.addAll(AttributeValues.parseValues(file));
  }

  if (agentNames.isEmpty()) {
    throw new CLIException(
        getResourceString("missing-agent-names"), ExitCodes.REQUEST_CANNOT_BE_PROCESSED);
  }

  String displayableNames = tokenize(agentNames);
  String[] params = {realm, displayableNames};
  writeLog(LogWriter.LOG_ACCESS, Level.INFO, "ATTEMPT_DELETE_AGENTS", params);

  try {
    AMIdentityRepository amir = new AMIdentityRepository(adminSSOToken, realm);
    Set setDelete = new HashSet();

    for (Iterator i = agentNames.iterator(); i.hasNext(); ) {
      String name = (String) i.next();
      AMIdentity amid = new AMIdentity(adminSSOToken, name, IdType.AGENTONLY, realm, null);
      setDelete.add(amid);
    }

    amir.deleteIdentities(setDelete);
    IOutput outputWriter = getOutputWriter();
    outputWriter.printlnMessage(getResourceString("delete-agent-succeeded"));

    for (Iterator i = agentNames.iterator(); i.hasNext(); ) {
      outputWriter.printlnMessage(" " + (String) i.next());
    }

    writeLog(LogWriter.LOG_ACCESS, Level.INFO, "SUCCEED_DELETE_AGENTS", params);
  } catch (IdRepoException e) {
    String[] args = {realm, displayableNames, e.getMessage()};
    debugError("DeleteAgents.handleRequest", e);
    writeLog(LogWriter.LOG_ERROR, Level.INFO, "FAILED_DELETE_AGENTS", args);
    throw new CLIException(e, ExitCodes.REQUEST_CANNOT_BE_PROCESSED);
  } catch (SSOException e) {
    String[] args = {realm, displayableNames, e.getMessage()};
    debugError("DeleteAgents.handleRequest", e);
    writeLog(LogWriter.LOG_ERROR, Level.INFO, "FAILED_DELETE_AGENTS", args);
    throw new CLIException(e, ExitCodes.REQUEST_CANNOT_BE_PROCESSED);
  }
}

public static void checkOptStrings(
    List strings, int maxLength, int totalMaxLength, String property, String name) {
  if (strings == null) {
    return;
  }
  int totalLength = 0;
  for (Iterator iter = strings.iterator(); iter.hasNext(); ) {
    String s = (String) iter.next();
    checkString(s, maxLength, property, name);
    totalLength += s.length();
    if (totalLength > totalMaxLength) {
      signalLengthViolation(property, name, totalMaxLength);
    }
  }
}

private void embeddedJpegTest() throws Exception {
  PGPPublicKeyRing pgpPub = new PGPPublicKeyRing(testPubKey, new BcKeyFingerprintCalculator());
  PGPSecretKeyRing pgpSec = new PGPSecretKeyRing(testPrivKey, new BcKeyFingerprintCalculator());

  PGPPublicKey pubKey = pgpPub.getPublicKey();

  PGPUserAttributeSubpacketVectorGenerator vGen = new PGPUserAttributeSubpacketVectorGenerator();

  vGen.setImageAttribute(ImageAttribute.JPEG, jpegImage);

  PGPUserAttributeSubpacketVector uVec = vGen.generate();

  PGPSignatureGenerator sGen =
      new PGPSignatureGenerator(
          new BcPGPContentSignerBuilder(
              PublicKeyAlgorithmTags.RSA_GENERAL, HashAlgorithmTags.SHA1));

  sGen.init(
      PGPSignature.POSITIVE_CERTIFICATION,
      pgpSec
          .getSecretKey()
          .extractPrivateKey(
              new BcPBESecretKeyDecryptorBuilder(new BcPGPDigestCalculatorProvider())
                  .build(pass)));

  PGPSignature sig = sGen.generateCertification(uVec, pubKey);

  PGPPublicKey nKey = PGPPublicKey.addCertification(pubKey, uVec, sig);

  Iterator it = nKey.getUserAttributes();
  int count = 0;
  while (it.hasNext()) {
    PGPUserAttributeSubpacketVector attributes = (PGPUserAttributeSubpacketVector) it.next();

    Iterator sigs = nKey.getSignaturesForUserAttribute(attributes);
    int sigCount = 0;
    while (sigs.hasNext()) {
      PGPSignature s = (PGPSignature) sigs.next();

      s.init(new BcPGPContentVerifierBuilderProvider(), pubKey);

      if (!s.verifyCertification(attributes, pubKey)) {
        fail("added signature failed verification");
      }

      sigCount++;
    }

    if (sigCount != 1) {
      fail("Failed added user attributes signature check");
    }
    count++;
  }

  if (count != 1) {
    fail("didn't find added user attributes");
  }

  nKey = PGPPublicKey.removeCertification(nKey, uVec);
  count = 0;
  for (it = nKey.getUserAttributes(); it.hasNext(); ) {
    count++;
  }
  if (count != 0) {
    fail("found attributes where none expected");
  }
}

