/** Initialize. */
public void contextInitialized(ServletContextEvent event) {
  // The the location of resource and registration files.
  Set paths = event.getServletContext().getResourcePaths("/tools/");
  if (paths == null) return;

  // First Pass: Search for tool registration file.
  for (Iterator i = paths.iterator(); i.hasNext(); ) {
    String path = (String) i.next();

    // skip directories
    if (path.endsWith("/")) continue;

    // If an XML file, use it as the tool registration file.
    if (path.endsWith(".xml")) {
      M_log.info("registering tools from resource: " + path);
      ActiveToolManager.register(
          event.getServletContext().getResourceAsStream(path), event.getServletContext());
    }
  }

  // Second pass, search for message bundles. Two passes are necessary to make sure the tool is
  // registered first.
  for (Iterator j = paths.iterator(); j.hasNext(); ) {
    String path = (String) j.next();

    // skip directories
    if (path.endsWith("/")) continue;

    // Check for a message properties file.
    if (path.endsWith(".properties")) {
      // Extract the tool id from the resource file name.
      File reg = new File(path);
      String tn = reg.getName();
      String tid = null;
      if (tn.indexOf('_') == -1) tid = tn.substring(0, tn.lastIndexOf('.')); // Default file.
      else tid = tn.substring(0, tn.indexOf('_')); // Locale-based file.

      String msg =
          event
              .getServletContext()
              .getRealPath(path.substring(0, path.lastIndexOf('.')) + ".properties");
      if (tid != null) {
        ActiveToolManager.setResourceBundle(tid, msg);
        M_log.info("Added localization resources for " + tid);
      }
    }
  }
}

public void test_getOutRelated() {
  Iterator itr = m_edge.getOutRelated();

  OptDirectedEdge de = (OptDirectedEdge) itr.next();
  assertTrue(de == m_outEdge);

  assertTrue(!itr.hasNext());

  // add same edge (shouldn't show up in iterator this time)
  addSame();

  itr = m_edge.getOutRelated();

  de = (OptDirectedEdge) itr.next();
  assertTrue(de == m_outEdge);

  assertTrue(!itr.hasNext());

  // add multiple same edge (shouldn't show up in iterator this time)
  addSame2();

  itr = m_edge.getOutRelated();

  de = (OptDirectedEdge) itr.next();
  assertTrue(de == m_outEdge);

  assertTrue(!itr.hasNext());

  // add opposite edge
  addOpp();

  itr = m_edge.getOutRelated();

  de = (OptDirectedEdge) itr.next();
  assertTrue(de == m_outEdge || de == m_opp);

  de = (OptDirectedEdge) itr.next();
  assertTrue(de == m_outEdge || de == m_opp);

  assertTrue(!itr.hasNext());

  // add another opposite edge
  addOpp2();

  itr = m_edge.getOutRelated();

  de = (OptDirectedEdge) itr.next();
  assertTrue(de == m_outEdge || de == m_opp || de == m_opp2);

  de = (OptDirectedEdge) itr.next();
  assertTrue(de == m_outEdge || de == m_opp || de == m_opp2);

  de = (OptDirectedEdge) itr.next();
  assertTrue(de == m_outEdge || de == m_opp || de == m_opp2);

  assertTrue(!itr.hasNext());

  // add loop
  addLoops();

  itr = m_edge.getOutRelated();

  de = (OptDirectedEdge) itr.next();
  assertTrue(de == m_outEdge || de == m_outloop);

  de = (OptDirectedEdge) itr.next();
  assertTrue(de == m_outEdge || de == m_outloop);

  assertTrue(!itr.hasNext());
}

