public Map getOpenSessionsByServer() {
  List all = m_storage.getOpenSessions();

  Map byServer = new TreeMap();

  List current = null;
  String key = null;

  for (Iterator i = all.iterator(); i.hasNext(); ) {
    UsageSession s = (UsageSession) i.next();

    // to start, or when the server changes, create a new inner list and add to the map
    if ((key == null) || (!key.equals(s.getServer()))) {
      key = s.getServer();
      current = new Vector();
      byServer.put(key, current);
    }

    current.add(s);
  }

  return byServer;
}

/** Called for all collections */
public static void bindCollectionSecondPass(
    Element node,
    Collection collection,
    java.util.Map persistentClasses,
    Mappings mappings,
    java.util.Map inheritedMetas)
    throws MappingException {

  if (collection.isOneToMany()) {
    OneToMany oneToMany = (OneToMany) collection.getElement();
    String assocClass = oneToMany.getReferencedEntityName();
    PersistentClass persistentClass = (PersistentClass) persistentClasses.get(assocClass);
    if (persistentClass == null) {
      throw new MappingException("Association references unmapped class: " + assocClass);
    }
    oneToMany.setAssociatedClass(persistentClass);
    collection.setCollectionTable(persistentClass.getTable());

    if (LOG.isDebugEnabled()) {
      LOG.debugf(
          "Mapping collection: %s -> %s",
          collection.getRole(), collection.getCollectionTable().getName());
    }
  }

  // CHECK
  Attribute chNode = node.attribute("check");
  if (chNode != null) {
    collection.getCollectionTable().addCheckConstraint(chNode.getValue());
  }

  // contained elements:
  Iterator iter = node.elementIterator();
  while (iter.hasNext()) {
    Element subnode = (Element) iter.next();
    String name = subnode.getName();

    if ("key".equals(name)) {
      KeyValue keyVal;
      String propRef = collection.getReferencedPropertyName();
      if (propRef == null) {
        keyVal = collection.getOwner().getIdentifier();
      } else {
        keyVal = (KeyValue) collection.getOwner().getRecursiveProperty(propRef).getValue();
      }
      SimpleValue key = new DependantValue(mappings, collection.getCollectionTable(), keyVal);
      key.setCascadeDeleteEnabled("cascade".equals(subnode.attributeValue("on-delete")));
      bindSimpleValue(
          subnode, key, collection.isOneToMany(), Collection.DEFAULT_KEY_COLUMN_NAME, mappings);
      collection.setKey(key);

      Attribute notNull = subnode.attribute("not-null");
      ((DependantValue) key).setNullable(notNull == null || notNull.getValue().equals("false"));
      Attribute updateable = subnode.attribute("update");
      ((DependantValue) key)
          .setUpdateable(updateable == null || updateable.getValue().equals("true"));

    } else if ("element".equals(name)) {
      SimpleValue elt = new SimpleValue(mappings, collection.getCollectionTable());
      collection.setElement(elt);
      bindSimpleValue(subnode, elt, true, Collection.DEFAULT_ELEMENT_COLUMN_NAME, mappings);
    } else if ("many-to-many".equals(name)) {
      ManyToOne element = new ManyToOne(mappings, collection.getCollectionTable());
      collection.setElement(element);
      bindManyToOne(subnode, element, Collection.DEFAULT_ELEMENT_COLUMN_NAME, false, mappings);
      bindManyToManySubelements(collection, subnode, mappings);
    } else if ("composite-element".equals(name)) {
      Component element = new Component(mappings, collection);
      collection.setElement(element);
      bindComposite(
          subnode, element, collection.getRole() + ".element", true, mappings, inheritedMetas);
    } else if ("many-to-any".equals(name)) {
      Any element = new Any(mappings, collection.getCollectionTable());
      collection.setElement(element);
      bindAny(subnode, element, true, mappings);
    } else if ("cache".equals(name)) {
      collection.setCacheConcurrencyStrategy(subnode.attributeValue("usage"));
      collection.setCacheRegionName(subnode.attributeValue("region"));
    }

    String nodeName = subnode.attributeValue("node");
    if (nodeName != null) collection.setElementNodeName(nodeName);
  }

  if (collection.isOneToMany() && !collection.isInverse() && !collection.getKey().isNullable()) {
    // for non-inverse one-to-many, with a not-null fk, add a backref!
    String entityName = ((OneToMany) collection.getElement()).getReferencedEntityName();
    PersistentClass referenced = mappings.getClass(entityName);
    Backref prop = new Backref();
    prop.setName(
        '_' + collection.getOwnerEntityName() + "." + node.attributeValue("name") + "Backref");
    prop.setUpdateable(false);
    prop.setSelectable(false);
    prop.setCollectionRole(collection.getRole());
    prop.setEntityName(collection.getOwner().getEntityName());
    prop.setValue(collection.getKey());
    referenced.addProperty(prop);
  }
}

/**
 * Sets the list of addresses of peers to which this provider will send events to. The peers are
 * semicolon-separated <code>names</code> list in the form of "myhost1:portA;myhost2:portB".
 */
public void setAddresses(String names) throws UnknownHostException {
  // NYI. Could look for equivalence of addresses and avoid
  // changing those that didn't change.

  _addressesLock.lock();
  try {
    for (Iterator<HostAddress> iter = _addresses.iterator(); iter.hasNext(); ) {
      iter.next().close();
    }
    String[] toks = StringUtil.split(names, ";", 0);
    _addresses = new ArrayList<>(toks.length);

    InetAddress localhost = InetAddress.getLocalHost();
    String localhostName = localhost.getHostName();

    for (int i = 0; i < toks.length; i++) {
      String host = toks[i];
      String hostname;
      int tmpPort;
      int colon = host.indexOf(':');
      if (colon != -1) {
        hostname = host.substring(0, colon);
        tmpPort = Integer.parseInt(host.substring(colon + 1));
      } else {
        hostname = host;
        tmpPort = DEFAULT_PORT;
      }
      InetAddress tmpAddress =
          AccessController.doPrivileged(J2DoPrivHelper.getByNameAction(hostname));

      // bleair: For each address we would rather make use of
      // the jdk1.4 isLinkLocalAddress () || isLoopbackAddress ().
      // (Though in practice on win32 they don't work anyways!)
      // Instead we will check hostname. Not perfect, but
      // it will match often enough (people will typically
      // use the DNS machine names and be cutting/pasting.)
      if (localhostName.equals(hostname)) {
        // This string matches the hostname for for ourselves, we
        // don't actually need to send ourselves messages.
        if (log.isTraceEnabled()) {
          log.trace(s_loc.get("tcp-address-asself", tmpAddress.getHostName() + ":" + tmpPort));
        }
      } else {
        HostAddress newAddress = new HostAddress(host);
        _addresses.add(newAddress);
        if (log.isTraceEnabled()) {
          log.trace(
              s_loc.get(
                  "tcp-address-set", newAddress._address.getHostName() + ":" + newAddress._port));
        }
      }
    }
  } catch (PrivilegedActionException pae) {
    throw (UnknownHostException) pae.getException();
  } finally {
    _addressesLock.unlock();
  }
}

void process(SSOToken ssoToken) throws AdminException {
  String[] args = {realm, idName, idType};
  AdminReq.writer.println(
      MessageFormat.format(AdminReq.bundle.getString("delegation-add-privileges"), args));

  try {
    doLog(args, "ATTEMPT_ADD_PRIVILEGES");
    AMIdentity amid =
        new AMIdentity(ssoToken, idName, AdminXMLParser.convert2IdType(idType), realm, null);
    String uid = amid.getUniversalId();
    DelegationManager mgr = new DelegationManager(ssoToken, realm);
    Set privilegeObjects = mgr.getPrivileges();

    for (Iterator i = setPrivileges.iterator(); i.hasNext(); ) {
      String name = (String) i.next();
      DelegationPrivilege dp = AdminUtils.getDelegationPrivilege(name, privilegeObjects);
      if (dp != null) {
        Set subjects = dp.getSubjects();
        if (!subjects.contains(uid)) {
          subjects.add(uid);
          mgr.removePrivilege(name);
          mgr.addPrivilege(dp);
        } else {
          String[] param = {name};
          String msg =
              MessageFormat.format(
                  AdminReq.bundle.getString("delegation-already-has-privilege"), param);
          throw new AdminException(msg);
        }
      } else {
        Set subjects = new HashSet(2);
        subjects.add(uid);
        DelegationPrivilege newDp = new DelegationPrivilege(name, subjects, realm);
        mgr.addPrivilege(newDp);
      }
    }

    doLog(args, "ADD_PRIVILEGES");
  } catch (DelegationException e) {
    throw new AdminException(e);
  } catch (SSOException e) {
    throw new AdminException(e);
  }
}

private Set getServiceComponents(String orgName, String path, boolean b)
    throws SMSException, SSOException {
  ServiceConfig sc =
      (orgName.equals(_rootDN))
          ? _smapi.getGlobalConfig(null)
          : _smapi.getOrganizationConfig(orgName, null);
  if (sc == null) {
    return new HashSet();
  }

  // Parser the "/" seperated path to get the right service config
  StringTokenizer st = new StringTokenizer(path, "/");
  while (st.hasMoreTokens()) {
    String token = st.nextToken();
    if ((token.length() == 0) || (token.length() == 0)) {
      continue;
    }
    sc = sc.getSubConfig(token);
  }
  Set answer = new HashSet();
  Iterator comps = sc.getSubConfigNames().iterator();
  while (comps.hasNext()) {
    answer.add(path + "/" + comps.next());
  }
  return (answer);
}

