          treeNode.put("allowModify", true);
          treeNode.put("allowSet", true);
          treeNode.put("allowBrowse", true);
          treeNode.put("name", f.getName());
          treeNode.put("remarks", root.getAttributeValue("remarks"));
          result.put(treeNode);
        }
