private void visitCode(Element code) {
  if (code == null) return;
  Iterator it = code.getDescendants();
  while (it.hasNext()) {
    Element inst = (Element) it.next();
    String type = inst.getAttributeValue("type");
    if (type != null) addType(type);
    type = inst.getAttributeValue("class-type");
    if (type != null) addType(type);
    if (inst.getName().startsWith("invoke")) visitInvoke(inst);
  }
}

private void processTasks() {
  if (implicitTag != null) {
    return;
  }
  for (Iterator i = unknownElements.iterator(); i.hasNext(); ) {
    UnknownElement ue = (UnknownElement) i.next();
    String name = ProjectHelper.extractNameFromComponentName(ue.getTag()).toLowerCase(Locale.US);
    if (getNsElements().get(name) == null) {
      throw new BuildException("unsupported element " + name);
    }
    if (presentElements.get(name) != null) {
      throw new BuildException("Element " + name + " already present");
    }
    presentElements.put(name, ue);
  }
}

/**
 * Given an entity-containing-element (startNode) recursively locate all entity names defined
 * within that element.
 *
 * @param mappings The already processed mappings
 * @param startNode The containing element
 * @param handler The thing that knows what to do whenever we recognize an entity-name
 */
private static void recognizeEntities(
    Mappings mappings, final Element startNode, EntityElementHandler handler) {
  Iterator[] classes = new Iterator[4];
  classes[0] = startNode.elementIterator("class");
  classes[1] = startNode.elementIterator("subclass");
  classes[2] = startNode.elementIterator("joined-subclass");
  classes[3] = startNode.elementIterator("union-subclass");

  Iterator classIterator = new JoinedIterator(classes);
  while (classIterator.hasNext()) {
    Element element = (Element) classIterator.next();
    handler.handleEntity(
        element.attributeValue("entity-name"), element.attributeValue("name"), mappings);
    recognizeEntities(mappings, element, handler);
  }
}

public static String getMultipartSignature(String sharedSecret, List params) {
  List ignoreParameters = new ArrayList();
  ignoreParameters.add("photo");

  addAuthToken(params);

  StringBuffer buffer = new StringBuffer();
  buffer.append(sharedSecret);
  Collections.sort(params, new ParameterAlphaComparator());
  Iterator iter = params.iterator();
  while (iter.hasNext()) {
    Parameter param = (Parameter) iter.next();
    if (!ignoreParameters.contains(param.getName().toLowerCase())) {
      buffer.append(param.getName());
      buffer.append(param.getValue());
    }
  }

  try {
    MessageDigest md = MessageDigest.getInstance("MD5");
    return ByteUtilities.toHexString(md.digest(buffer.toString().getBytes("UTF-8")));
  } catch (NoSuchAlgorithmException e) {
    throw new RuntimeException(e);
  } catch (UnsupportedEncodingException u) {
    throw new RuntimeException(u);
  }
}

/**
 * Is this resource referred to in any of the references in the vector? Accept any Resource, or a
 * String assumed to be a resource reference.
 *
 * @param o The Resource (or resource reference string) to check for presence in the references in
 *     the vector.
 * @return true if the resource referred to in any of the references in the Vector, false if not.
 */
public boolean contains(Object o) {
  if ((o instanceof Entity) || (o instanceof String) || (o instanceof Reference)) {
    String ref = null;
    if (o instanceof Entity) {
      ref = ((Entity) o).getReference();
    } else if (o instanceof String) {
      ref = (String) o;
    } else {
      ref = ((Reference) o).getReference();
    }

    Iterator it = iterator();
    while (it.hasNext()) {
      Reference de = (Reference) it.next();
      if (de.getReference().equals(ref)) return true;
    }

    return false;
  } else return super.contains(o);
}

private void doSerialize(SerializableCollectionAccess sc, DataOutputStream ds)
    throws EntityParseException, IOException {
  String id = sc.getSerializableId();
  boolean hidden = sc.getSerializableHidden();
  AccessMode access = sc.getSerializableAccess();
  Time releaseDate = sc.getSerializableReleaseDate();
  Time retractDate = sc.getSerializableRetractDate();
  Collection<String> groups = sc.getSerializableGroup();

  ds.writeInt(TYPE1);
  ds.writeInt(BLOCK1);
  ds.writeUTF(id);
  ds.writeUTF(ResourceType.TYPE_FOLDER);

  if (access == null || AccessMode.SITE == access) {
    access = AccessMode.INHERITED;
  }

  ds.writeUTF(access.toString());
  ds.writeBoolean(hidden);
  ds.writeInt(BLOCK2);
  if (!hidden && releaseDate != null) {
    ds.writeLong(releaseDate.getTime());
  } else {
    ds.writeLong(-1);
  }
  if (!hidden && retractDate != null) {
    ds.writeLong(retractDate.getTime());
  } else {
    ds.writeLong(-1);
  }
  if (groups != null) {
    ds.writeInt(BLOCK3);
    ds.writeInt(groups.size());
    for (Iterator igroup = groups.iterator(); igroup.hasNext(); ) {
      String groupRef = (String) igroup.next();
      ds.writeUTF(groupRef);
    }
  }

  ds.writeInt(BLOCK4);
  baseResourcePropertiesSerializer.serialize(sc.getSerializableProperties(), ds);
  ds.writeInt(BLOCK_END);
}

