/**
 * Returns the actions associated with the current steps allowed by the given step filter
 *
 * @param filter a step filter that allows the desired steps to pass through
 * @return a list of WorkflowActionVOs representing the actions associated with the current steps
 *     allowed by filter
 * @see #getCurrentSteps(StepFilter)
 */
public List getAvailableActions(StepFilter filter) {
  List steps = (filter == null) ? currentSteps : getCurrentSteps(filter);
  List availableActions = new ArrayList();

  for (Iterator i = steps.iterator(); i.hasNext(); )
    availableActions.addAll(((WorkflowStepVO) i.next()).getActions());

  return availableActions;
}

/** Set lookahead to next non-null element or null if nothing left */
protected void consume() {
  if (!it.hasNext()) {
    lookahead = null;
    return;
  }
  Object e = null;
  // scan for next non-null value
  while (e == null && it.hasNext()) {
    e = it.next();
  }
  lookahead = e;
}

public Graph<String, String> createGraph() {
  SparseTree<String, String> graph = new SparseTree<String, String>();
  if (clusterModel.getRootNode() == null) return graph;

  ClusterNode root = clusterModel.getRootNode();
  graph.addVertex("Root");
  vertexMap.put("Root", root);

  Iterator<ClusterNode> it = clusterModel.getRootNode().getSubNodes();
  while (it.hasNext()) createGraph(graph, "Root", it.next());

  return graph;
}

