/**
 * Checks for validity of the viewId. For instance, "CANCEL" is the same as "cancel". So this
 * method normalizes the view id.
 *
 * <p>When the client is doing some logic for some view, it first should normalize it with this
 * method
 *
 * @return the normalized viewId (lowercase), when the viewId is <code>null</code> it returns the
 *     default view id
 */
protected final String normalize(String viewId) {
  if (viewId == null || "".equals(viewId.trim())) {
    return Constants.Request.DEFAULT_VIEW_ID;
  }
  for (Iterator i = supportedViewIds.iterator(); i.hasNext(); ) {
    String id = (String) i.next();
    if (id.equalsIgnoreCase(viewId)) {
      return id;
    }
  }
  return viewId.toLowerCase();
}

