/**
 * Return a printable representation of the <code>CertSelector</code>.<br>
 * <br>
 * <b>TODO: implement output for currently unsupported options(name constraints)</b><br>
 * <br>
 * Uses {@link org.bouncycastle.asn1.ASN1InputStream ASN1InputStream}, {@link
 * org.bouncycastle.asn1.ASN1Object ASN1Object}, {@link org.bouncycastle.asn1.x509.KeyPurposeId
 * KeyPurposeId}
 *
 * @return a <code>String</code> describing the contents of the <code>CertSelector</code>
 */
public String toString() {
  StringBuffer sb = new StringBuffer();
  sb.append("X509CertSelector: [\n");
  if (x509Cert != null) {
    sb.append(" Certificate: ").append(x509Cert).append('\n');
  }
  if (serialNumber != null) {
    sb.append(" Serial Number: ").append(serialNumber).append('\n');
  }
  if (issuerDN != null) {
    sb.append(" Issuer: ").append(getIssuerAsString()).append('\n');
  }
  if (subjectDN != null) {
    sb.append(" Subject: ").append(getSubjectAsString()).append('\n');
  }
  try {
    if (subjectKeyID != null) {
      ByteArrayInputStream inStream = new ByteArrayInputStream(subjectKeyID);
      ASN1InputStream derInStream = new ASN1InputStream(inStream);
      ASN1Object derObject = derInStream.readObject();
      sb.append(" Subject Key Identifier: ")
          .append(ASN1Dump.dumpAsString(derObject))
          .append('\n');
    }
    if (authorityKeyID != null) {
      ByteArrayInputStream inStream = new ByteArrayInputStream(authorityKeyID);
      ASN1InputStream derInStream = new ASN1InputStream(inStream);
      ASN1Object derObject = derInStream.readObject();
      sb.append(" Authority Key Identifier: ")
          .append(ASN1Dump.dumpAsString(derObject))
          .append('\n');
    }
  } catch (IOException ex) {
    sb.append(ex.getMessage()).append('\n');
  }
  if (certValid != null) {
    sb.append(" Certificate Valid: ").append(certValid).append('\n');
  }
  if (privateKeyValid != null) {
    sb.append(" Private Key Valid: ").append(privateKeyValid).append('\n');
  }
  if (subjectKeyAlgID != null) {
    sb.append(" Subject Public Key AlgID: ").append(subjectKeyAlgID).append('\n');
  }
  if (subjectPublicKey != null) {
    sb.append(" Subject Public Key: ").append(subjectPublicKey).append('\n');
  }
  if (keyUsage != null) {
    sb.append(" Key Usage: ").append(keyUsage).append('\n');
  }
  if (keyPurposeSet != null) {
    sb.append(" Extended Key Usage: ").append(keyPurposeSet).append('\n');
  }
  if (policy != null) {
    sb.append(" Policy: ").append(policy).append('\n');
  }
  sb.append(" matchAllSubjectAltNames flag: ").append(matchAllSubjectAltNames).append('\n');
  if (subjectAltNamesByte != null) {
    sb.append(" SubjectAlternativNames: \n[");
    Iterator iter = subjectAltNamesByte.iterator();
    List obj;
    try {
      while (iter.hasNext()) {
        obj = (List) iter.next();
        ByteArrayInputStream inStream = new ByteArrayInputStream((byte[]) obj.get(1));
        ASN1InputStream derInStream = new ASN1InputStream(inStream);
        ASN1Object derObject = derInStream.readObject();
        sb.append(" Type: ")
            .append(obj.get(0))
            .append(" Data: ")
            .append(ASN1Dump.dumpAsString(derObject))
            .append('\n');
      }
    } catch (IOException ex) {
      sb.append(ex.getMessage()).append('\n');
    }
    sb.append("]\n");
  }
  if (pathToNamesByte != null) {
    sb.append(" PathToNamesNames: \n[");
    Iterator iter = pathToNamesByte.iterator();
    List obj;
    try {
      while (iter.hasNext()) {
        obj = (List) iter.next();
        ByteArrayInputStream inStream = new ByteArrayInputStream((byte[]) obj.get(1));
        ASN1InputStream derInStream = new ASN1InputStream(inStream);
        ASN1Object derObject = derInStream.readObject();
        sb.append(" Type: ")
            .append(obj.get(0))
            .append(" Data: ")
            .append(ASN1Dump.dumpAsString(derObject))
            .append('\n');
      }
    } catch (IOException ex) {
      sb.append(ex.getMessage()).append('\n');
    }
    sb.append("]\n");
  }
  sb.append(']');
  return sb.toString();
}

/**
 * Remove this entry from the cache.
 *
 * @param key The cache key.
 */
public synchronized void remove(Object key) {
  if (disabled()) return;

  Notification payload = (Notification) cache.get(key);
  cache.remove(key);

  if (payload == null) return;

  // remove it from the function map for each function
  List funcs = payload.getFunctions();
  for (Iterator iFuncs = funcs.iterator(); iFuncs.hasNext(); ) {
    String func = (String) iFuncs.next();

    List notifications = (List) m_functionMap.get(func);
    if (notifications != null) {
      notifications.remove(payload);
      if (notifications.isEmpty()) {
        m_functionMap.remove(func);
      }
    }
  }
} // remove

/**
 * Styles all existing resources.
 *
 * @since Ant 1.7
 */
private void processResources(Resource stylesheet) {
  Iterator iter = resources.iterator();
  while (iter.hasNext()) {
    Resource r = (Resource) iter.next();
    if (!r.isExists()) {
      continue;
    }
    File base = baseDir;
    String name = r.getName();
    if (r instanceof FileResource) {
      FileResource f = (FileResource) r;
      base = f.getBaseDir();
      if (base == null) {
        name = f.getFile().getAbsolutePath();
      }
    }
    process(base, name, destDir, stylesheet);
  }
}

