          orInClause(realms.size(), "SR.REALM_ID"));
  Object[] fields = new Object[1 + realms.size()];
  fields[0] = role;
  int pos = 1;
  for (Iterator i = realms.iterator(); i.hasNext(); ) {
    String roleRealm = (String) i.next();
    fields[pos++] = roleRealm;
  }

  // read the strings
